import React, {useRef} from "react";
import styles from './CalendarPresent.module.css';

function CalendarPresent({year, month, cellsArr, handleClickForward}) {
    const monthObj = {
        0: ['Січень', 'isWinter'],
        1: ['Лютий', 'isWinter'],
        2: ['Березень', 'isSpring'],
        3: ['Квітень', 'isSpring'],
        4: ['Травень', 'isSpring'],
        5: ['Червень', 'isSummer'],
        6: ['Липень', 'isSummer'],
        7: ['Серпень', 'isSummer'],
        8: ['Вересень', 'isAutumn'],
        9: ['Жовтень', 'isAutumn'],
        10: ['Листопад', 'isAutumn'],
        11: ['Грудень', 'isWinter'],

    }

        const copy = [...cellsArr];
        const firstPart = useRef(copy.splice(0, 7));
        const secondPart = useRef(copy.splice(0, 7));
        const thirdPart = useRef(copy.splice(0, 7));
        const fourthPart = useRef(copy.splice(0, 7));
        const fifthPart = useRef(copy.splice(0, 7));
        const sixPart = useRef(copy.splice(0, 7));
        const cellsArrDivided = useRef([]);
        cellsArrDivided.current.push(firstPart.current, secondPart.current, thirdPart.current, fourthPart.current, fifthPart.current, sixPart.current);
        //console.log(cellsArrDivided.current);


    function Rows() {

        function styleForToday(data) {
            const style = styles.isToday;
            if(data.isToday) {
                return style;
            } else {
                return null;
            }
        }

        const res = cellsArrDivided.current.map((elem, index) => {
           for(let i = 0; i < elem.length; i++) {
            //console.log(elem[i].value, index);
           return <tr key={index}> 
           <td className={styleForToday(elem[0])}>{elem[0].value}</td><td className={styleForToday(elem[1])}>{elem[1].value}</td> 
           <td className={styleForToday(elem[2])}>{elem[2].value}</td><td className={styleForToday(elem[3])}>{elem[3].value}</td>
           <td className={styleForToday(elem[4])}>{elem[4].value}</td><td className={[styles.isWeekend, styleForToday(elem[5])]}>{elem[5].value}</td>
           <td className={[styles.isWeekend, styleForToday(elem[6])]}>{elem[6].value}</td>
           </tr>
           }
        }) 
        return res;
    }


return <div>
    <h2>{monthObj[month][0]} {year}</h2>
    <table className={styles[monthObj[month][1]]}>
        <thead>
            <tr>
                <td>Пн</td><td>Вт</td><td>Ср</td><td>Чт</td><td>Пт</td> 
                <td className={styles.isWeekend}>Сб</td><td className={styles.isWeekend}>Нд</td>
            </tr>
        </thead>
        <tbody>
           <Rows />
        </tbody>
    </table>
    <div className={styles.buttons}>
        <button>Назад</button>
        <button onClick={handleClickForward}>Вперед</button>
    </div>
</div>
}

export default CalendarPresent;
